/*
* Prefixed by https://autoprefixer.github.io
* PostCSS: v7.0.29,
* Autoprefixer: v9.7.6
* Browsers: last 4 version
*/


:root {
  font-size:16px;
  --dark01: #171216;
  --dark02: #473F45;
  --dark03: #888888;
  --bright01: #fafafa;
  --bright02: #eeeeee;
  --bright03:#EDEBFD;
  --bright04:#D9D8DE;
  --action: #DE6B6B;
  --accent01: #91768C ;
  --accent02: #FB8D91;
  --accent03: #136E13;
  --accent04: #0B330B;
  --primary01: #383E55;
  --primary02: #B71063;
  --primary03: #901452;
  --primary04: #20171E;
  --primary05: #23101F;
  --link_idle: #0080D4;
  --link_idle02: #005E9C;


  --internal_darks: var(--dark03);
  --line_width: 0.125em;
  --em-unitBase: 16;
  --em-unitBasePX: var(--em-unitBase) + "px";
  --body-lineHeight-min: 1.5;
  --body-lineHeight-max: 2;
  --core_tile_size: 64px;
  --border_radius: 0.2rem;
  /*breakpoints vars*/
  --min-screen-width: 300px;

  --bp-s: 24.15; /**/
  --bp-m: 43.75; /**/
  --bp-l: 60; /*960px*/
  --bp-xl: 75; /*1200px*/
  /*Typefaces*/
  --tf-heading: 'Playfair Display', serif;
  --tf-body:  'Lato', sans-serif;
  /*body vars*/
  --em-unitBase: 16;
  --em-unitBasePX: 16px;
  --body-lineHeight-min: 1.3;
  --body-lineHeight-max: 1.75;
/*typo_transition*/
  --type_distance: 0.5em;
  --type_speed: 0.3s;
}
body {
  font-size:16px;
  line-height: 1.5;
}
body,
div,
p,
th,
td,
ul,
li,
h1,
h2,
h3,
h4,
h5,
h6,
blockquote,
figcaption,
cite,
em,
b,
strong,
button {

  font-style: normal;
  font-variation-settings: "wght" var(--txt-wght), "ital" var(--txt-ital);

}
strong{
  font-family: inherit;
  font-weight:600;
}
ul, ol {
  margin: 0;
  padding: 0;
}

li {
  list-style: none;
  margin: 0;
  padding: 0;

}
ol li{
  list-style-type: decimal;
}
.paragraph a{
  outline:none;
  font-weight:bolder;
  padding:0.25em;
  text-decoration: none;
  color: var(--dark01);
}
.paragraph a:focus{

    background-image: -webkit-gradient(linear, left top, left bottom, from(var(--dark02)), to(var(--dark01)));
    background-image: -o-linear-gradient(var(--dark02), var(--dark01));
    background-image: linear-gradient(var(--dark02), var(--dark01));
  color: white;
  outline: 1px solid var(--dark01);
  outline-offset:2px;
}
.project_li a {
  text-decoration: none;
  border-radius:2px;
  border: none;
  margin-top:1em;
  margin-left: -0.5em;
  padding:0.25em;
  padding-left:0.5em;
  padding-right:0.5em;
  background-image: linear-gradient(-90deg, var(--primary03) 0%, var(--link_idle) 50%,transparent 50%, transparent 100%);
  background-size:200%;
  background-position:200%;
  transition:all 0.25s;
  background-repeat:no-repeat;
}
.project_li a:visited {
  color: var(--link_idle);
}
.project_li a:hover {
  background-position:100%;
  color: white;

}
.project_li a:active {

}
.project_li a:focus{
  outline:none;
  background-position:100%;
  color: white;
  outline: 1px solid var(--link_idle);
  outline-offset:2px;

}

.body_container {
  height: 100vh;
  width: 100vw;
  display: -ms-grid;
  display: grid;
  -ms-grid-rows: 100%;
  grid-template-rows: 100%;
  -ms-grid-columns: 64px auto;
  grid-template-columns: 64px auto;
  overflow: hidden;
  margin: 0;
  padding: 0;
  background: var(--bright01);
}

.body_container > *:nth-child(1) {
  -ms-grid-row:1;
  -ms-grid-column:1;
}

.body_container > *:nth-child(2) {
  -ms-grid-row:1;
  -ms-grid-column:2;
}

.heading_01 {
  --fontsize_min: 2rem;
  --fontsize_max: 5.5rem;
  font-family: var(--tf-heading);
  font-size: clamp( var(--fontsize_min), 7vmin, var(--fontsize_max));
  font-weight: 900;
  line-height: 1.25;
  letter-spacing: 0.01em;
}
.heading_02 {
  --fontsize_min: 1.625rem;
  --fontsize_max: 2.25rem;
  font-family: var(--tf-body);
  font-size: clamp( var(--fontsize_min), 4vmin, var(--fontsize_max));
  font-weight: medium;
  line-height: 1;
}
.heading_03 {
  --fontsize_min: 1.375rem;
  --fontsize_max: 1.75rem;
  font-family: var(--tf-body);
  font-size: clamp( var(--fontsize_min), 3vmin, var(--fontsize_max));
  font-weight: 600;
  line-height: 1.25;
}
.heading_04 {
  --fontsize_min: 1rem;
  --fontsize_max: 1.25rem;
  font-family: var(--tf-body);
  font-size: clamp( var(--fontsize_min), 2vmin, var(--fontsize_max));
  font-weight: light;
  line-height: 1.5;
}
.heading_05 {
  --fontsize_min: 0.875rem;
  --fontsize_max: 1.15rem;
  font-family: var(--tf-body);
  font-size: clamp( var(--fontsize_min), 5vmin, var(--fontsize_max));
  font-weight: 500;
  line-height: 1.5;
}
.heading_06 {
  --fontsize_min: 0.75rem;
  --fontsize_max: 1rem;
  font-family: var(--tf-body);
  font-size: clamp( var(--fontsize_min), 4vmin, var(--fontsize_max));
  font-weight: medium;
  line-height: 1.5;
}
.paragraph{
  margin-top:0.5rem;
  --fontsize_min: 0.875rem;
  --fontsize_max: 1.25rem;
  font-family: var(--tf-body);
  font-size: clamp( var(--fontsize_min), calc(0.5rem + 1vmin), var(--fontsize_max));
  font-weight: normal;
  line-height: 1.5;
  width: 60vw;
  max-width: 36em;
  word-break: normal;

}
.paragraph *{
  font-size: inherit;
}
.paragraph strong{
  font-family: inherit;
  font-size: inherit;
  -webkit-hyphens: inherit;
      -ms-hyphens: inherit;
          hyphens: inherit;
  font-weight: 600;
  line-height: inherit;

}
